const Gondula = (props) => {
  // const [filteredGondula, setFilteredGondula] = useState('Gond-1');

  // const filterChangeHandler = selectedGondula => {
  //   setFilteredGondula(selectedGondula);
  // };

  return (
    <div>
      <Card className='Gondula'>
        {/* <GondulaFilter selected={filteredGondula} onChangeFilter={filterChangeHandler} /> */}
        {props.planograms.map((planogram) => (
          <Shelf
            upc={planogram.upc}
            shelf={planogram.shelf}
            gondula={planogram.gondula}
          />

        ))}

      </Card>
    </div>
  );
};

export default Gondula;
